import React from 'react';

const Cartas = ({ numero, palo, index }) => {
    const imagen = `./Imagenes/${palo}/${numero}.png`;
    return (
        <div className="carta">
        <img src={imagen} alt={`Carta ${numero} de ${palo}`}  style={{ width: '100px', height: '100px'}} />
        </div>
    );
};

export default Cartas;
